import React from 'react'
import './App.css';
import Signup from './components/Signup/Signup'
import Geolocation from './components/Geolocation/Geolocation'

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>

      <Signup />
      <Geolocation />

    </div>
  );
}

export default App;
